//  Navbar 
function Navbar() {
  const [scrolled, setScrolled] = useState(false);
  useEffect(() => {
    const handler = () => setScrolled(window.scrollY > 40);
    window.addEventListener("scroll", handler);
    return () => window.removeEventListener("scroll", handler);
  }, []);
  return (
    <motion.nav
      initial={{ y: -80, opacity: 0 }}
      animate={{ y: 0, opacity: 1 }}
      transition={{ delay: 0.2, duration: 0.6 }}
      className={`fixed top-0 left-0 right-0 z-40 transition-all duration-300 ${scrolled ? "py-3" : "py-5"}`}
      style={{ background: scrolled ? "rgba(20,10,40,0.85)" : "transparent", backdropFilter: scrolled ? "blur(18px)" : "none" }}
    >
      <div className="max-w-6xl mx-auto px-6 flex items-center justify-between">
        <span className="text-3xl font-black text-white" style={{ fontFamily: "'Pacifico', cursive", textShadow: "0 2px 12px rgba(255,100,50,0.5)" }}>
           Frubee
        </span>
        <div className="hidden md:flex gap-8 text-white/80 text-sm font-medium tracking-wider">
          {["Flavors", "About", "Why Us", "Contact"].map(item => (
            <a key={item} href={`#${item.toLowerCase().replace(" ", "")}`}
              className="hover:text-white transition-colors hover:text-orange-300">{item}</a>
          ))}
        </div>
        <motion.a
          href="#contact"
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.97 }}
          className="px-5 py-2 rounded-full text-sm font-bold text-white"
          style={{ background: "linear-gradient(90deg, #ff6b35, #c72f7a)" }}
        >
          Get Yours 
        </motion.a>
      </div>
    </motion.nav>
  );
}

