//  Flavor Card 
function FlavorCard({ flavor, delay }) {
  const ref = useRef(null);
  const isInView = useInView(ref, { once: true });
  return (
    <motion.div
      ref={ref}
      initial={{ opacity: 0, y: 60 }}
      animate={isInView ? { opacity: 1, y: 0 } : {}}
      transition={{ duration: 0.7, delay, ease: "easeOut" }}
      whileHover={{ scale: 1.05, y: -8 }}
      className="relative rounded-3xl p-6 text-center cursor-pointer overflow-hidden group"
      style={{
        background: "rgba(255,255,255,0.06)",
        border: "1px solid rgba(255,255,255,0.12)",
        backdropFilter: "blur(20px)",
        boxShadow: `0 20px 60px ${flavor.glow}30`,
      }}
    >
      <div className="absolute inset-0 opacity-0 group-hover:opacity-100 transition-opacity duration-500 rounded-3xl"
        style={{ background: `radial-gradient(circle at 50% 70%, ${flavor.glow}20, transparent 70%)` }} />
      <motion.img
        src={flavor.img}
        alt={flavor.name}
        className="w-52 mx-auto mb-4 drop-shadow-2xl relative z-10"
        whileHover={{ rotate: [0, -3, 3, 0] }}
        transition={{ duration: 0.5 }}
      />
      <div className="relative z-10">
        <div className="inline-block px-3 py-1 rounded-full text-xs font-bold tracking-widest uppercase mb-2"
          style={{ background: flavor.glow + "25", color: flavor.glow, border: `1px solid ${flavor.glow}50` }}>
          {flavor.tag}
        </div>
        <h3 className="text-2xl font-black text-white mb-2" style={{ fontFamily: "'Pacifico', cursive" }}>
          {flavor.name}
        </h3>
        <p className="text-white/60 text-sm leading-relaxed">{flavor.desc}</p>
        <motion.button
          whileHover={{ scale: 1.08 }} whileTap={{ scale: 0.95 }}
          className="mt-4 px-6 py-2.5 rounded-full font-bold text-sm text-white"
          style={{ background: `linear-gradient(90deg, ${flavor.glow}, ${flavor.glow2})` }}
        >
          Try Now 
        </motion.button>
      </div>
    </motion.div>
  );
}

