//  Contact 
function ContactSection() {
  const [form, setForm] = useState({ name: "", email: "", message: "" });
  const [sent, setSent] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    setSent(true);
    setTimeout(() => setSent(false), 3000);
    setForm({ name: "", email: "", message: "" });
  };

  return (
    <section id="contact" className="py-24"
      style={{ background: "linear-gradient(135deg, #1a0a2e 0%, #0d0515 100%)" }}>
      <div className="max-w-2xl mx-auto px-6">
        <motion.div className="text-center mb-12"
          initial={{ opacity: 0, y: 40 }} whileInView={{ opacity: 1, y: 0 }} viewport={{ once: true }}>
          <span className="text-orange-400 text-sm font-bold tracking-widest uppercase">Say Hello</span>
          <h2 className="text-5xl font-black text-white mt-2" style={{ fontFamily: "'Pacifico', cursive" }}>
            Get in Touch
          </h2>
          <p className="text-white/50 mt-4">We'd love to hear from you. Buzz us anytime. </p>
        </motion.div>

        <motion.form
          onSubmit={handleSubmit}
          initial={{ opacity: 0, y: 40 }} whileInView={{ opacity: 1, y: 0 }} viewport={{ once: true }}
          className="rounded-3xl p-8 space-y-5"
          style={{ background: "rgba(255,255,255,0.05)", border: "1px solid rgba(255,255,255,0.1)", backdropFilter: "blur(20px)" }}
        >
          {[
            { key: "name", label: "Your Name", type: "text", placeholder: "e.g. Kasun Perera" },
            { key: "email", label: "Email Address", type: "email", placeholder: "kasun@example.com" },
          ].map(field => (
            <div key={field.key}>
              <label className="block text-white/60 text-sm mb-2 font-medium">{field.label}</label>
              <input
                type={field.type}
                value={form[field.key]}
                onChange={e => setForm({ ...form, [field.key]: e.target.value })}
                placeholder={field.placeholder}
                required
                className="w-full px-4 py-3 rounded-xl bg-white/8 border border-white/15 text-white placeholder-white/30 focus:outline-none focus:border-orange-500/60 transition-colors"
                style={{ background: "rgba(255,255,255,0.06)" }}
              />
            </div>
          ))}
          <div>
            <label className="block text-white/60 text-sm mb-2 font-medium">Message</label>
            <textarea
              rows={4}
              value={form.message}
              onChange={e => setForm({ ...form, message: e.target.value })}
              placeholder="Tell us how much you love Frubee"
              required
              className="w-full px-4 py-3 rounded-xl border border-white/15 text-white placeholder-white/30 focus:outline-none focus:border-orange-500/60 transition-colors resize-none"
              style={{ background: "rgba(255,255,255,0.06)" }}
            />
          </div>
          <AnimatePresence mode="wait">
            {sent ? (
              <motion.div key="sent"
                initial={{ scale: 0.8, opacity: 0 }} animate={{ scale: 1, opacity: 1 }} exit={{ opacity: 0 }}
                className="text-center py-3 rounded-xl font-bold text-white"
                style={{ background: "linear-gradient(90deg, #22c55e, #16a34a)" }}>
                 Message sent! We'll buzz back soon.
              </motion.div>
            ) : (
              <motion.button key="btn" type="submit"
                whileHover={{ scale: 1.03, boxShadow: "0 10px 40px rgba(255,107,53,0.4)" }}
                whileTap={{ scale: 0.97 }}
                className="w-full py-3.5 rounded-xl font-bold text-white text-lg"
                style={{ background: "linear-gradient(90deg, #ff6b35, #c72f7a)" }}>
                Send Message 
              </motion.button>
            )}
          </AnimatePresence>
        </motion.form>
      </div>
    </section>
  );
}

